package Algorithms;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class HashAnagram {

	
	//My solution to the anagram solver using hash map: use two maps and see if each value for each key is equal
	public static boolean HashAnaMINE() {
        
		//String s = "";
		//String t ="";
		
		String s = "appley";
		String t = "apyley";
			
		boolean answer = false;
		
        if(s.isEmpty()&&t.isEmpty()){
            answer = true;
            System.out.println("String empty, "+answer);
            return answer;
        }
        
        if(s.length()!=t.length()){
            answer = false;
            System.out.println("Strings different length, "+answer);
            return answer;
        }
        
        Map<Character, Integer> freqS = new HashMap<>();
    
        for(int i=0; i<s.length(); i++){
            if(freqS.containsKey(s.charAt(i))){
                freqS.put(s.charAt(i),freqS.get(s.charAt(i))+1);
                //System.out.println(s.charAt(i));
            } else{
                freqS.put(s.charAt(i),1);
            }
        }
        
        Map<Character, Integer> freqT = new HashMap<>();
        
        for(int j=0; j<t.length(); j++){
            if(freqT.containsKey(t.charAt(j))){
                freqT.put(t.charAt(j),freqT.get(t.charAt(j))+1);
            } else{
                freqT.put(t.charAt(j),1);
            }
        }
        
        for (Map.Entry<Character, Integer> entry : freqT.entrySet()) {
	        if(freqS.containsKey(entry.getKey())){	
        		int countT = freqT.get(entry.getKey());
	        	int countS = freqS.get(entry.getKey());
	        	//System.out.println(entry.getKey());
	            //System.out.println(countT);
	            //System.out.println(countS);
	        	if(countT==countS){
	                answer=true;
	                //System.out.println("String T :"+entry.getKey()+": "+freqT.get(entry.getKey()));
	                //System.out.println("String S :"+entry.getKey()+": "+freqS.get(entry.getKey()));
	            } else{
	                answer=false;
	                //System.out.println("String T :"+entry.getKey()+": "+freqT.get(entry.getKey()));
	                //System.out.println("String S :"+entry.getKey()+": "+freqS.get(entry.getKey()));
	                System.out.println("Count of char "+entry.getKey()+" in String T didn't match String S, "+answer);
	                return answer;
	            }
	        } else{
	        	answer = false;
	        	System.out.println(answer);
	        	System.out.println(entry.getKey()+" didn't exist in String s, "+answer);
	        	return answer;
	        }
        }
        
        System.out.println("The strings are anagrams, "+answer);
        return answer;         
        
    }
	
	//Their solution which sorts the two arrays then says if they equal each other
	public static boolean isAnagramSORT() {
		String s = "appley";
		String t = "apyley";
		if (s.length() != t.length()) {
	        return false;
	    }
	    char[] str1 = s.toCharArray();
	    char[] str2 = t.toCharArray();
	    Arrays.sort(str1);
	    Arrays.sort(str2);
	    return Arrays.equals(str1, str2);
	}
	
	
	//Their solution which counts and adds each instance of a character for one string and deducts for the other.  If final counts==0 then they are the same
	public static boolean isAnagramARRAY() {
		String s = "appleyz";
		String t = "apyleyz";
		if (s.length() != t.length()) {
	        return false;
	    }
	    int[] counter = new int[26];
	    for (int i = 0; i < s.length(); i++) {
	        System.out.println(s.charAt(i) - 'a');
	    	counter[s.charAt(i) - 'a']++;
	        counter[t.charAt(i) - 'a']--;
	    }
	    for (int count : counter) {
	        if (count != 0) {
	            return false;
	        }
	    }
	    return true;
	}
	
	
	//Their solution which counts one string then says deduct for other and if result ever less than zero, then end.
	public static boolean isAnagramARRAYQuick() {
		String s = "appley";
		String t = "apyley";
		if (s.length() != t.length()) {
	        return false;
	    }
	    int[] table = new int[26];
	    for (int i = 0; i < s.length(); i++) {
	        table[s.charAt(i) - 'a']++;
	    }
	    for (int i = 0; i < t.length(); i++) {
	        table[t.charAt(i) - 'a']--;
	        if (table[t.charAt(i) - 'a'] < 0) {
	            return false;
	        }
	    }
	    return true;
	}
	
}
